var legendData = [{
        name: 'aa',
        selected: true,
        icon: 'image://data:image/png;base64,'
    },
    {
        name: 'bb',
        selected: true,
        icon: 'image://data:image/png;base64,'
    }
]
option = {
    legend: {
        show: true,
        // icon: 'rect',
        type: 'scroll',
        data: legendData,
        right: 10,
        selector: true,
        itemWidth: 12,
        itemHeight: 12,
    },
    title: {
        text: 'Awesome Chart'
    },
    xAxis: {
        data: ['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat']
    },
    yAxis: {},
    series: [{
        type: 'line',
        name: 'aa',
        data: [1, 2, 3, 4, 5, 6, 7]
    }, {
        type: 'line',
        name: 'bb',
        data: [2, 3, 4, 5, 6, 7, 8]
    }]
};
myChart.on('legendselectchanged', (params) => {
    legendData.forEach(e => {
        if (e.name === params.name) {
            if (e.selected) {
                e.icon = 'image://data:image/png;base64,'
            } else {
                e.icon = 'image://data:image/png;base64,'

            }
            e.selected = !e.selected
        }
    })
    myChart.setOption({
        legend: {
            data: legendData
        }
    })
})
// 全选 此事件API文档未提供描述
myChart.on('legendselectall', (params) => {
    legendData.forEach(e => {
        e.selected = true
        e.icon = 'image://data:image/png;base64,'
    })
    myChart.setOption({
        legend: {
            data: legendData
        }
    })
})

// 反选 此事件API文档未提供描述
myChart.on('legendinverseselect', (params) => {
    legendData.forEach(e => {
        if (!params.selected[e.name]) {
            e.icon = 'image://data:image/png;base64,'
        } else {
            e.icon = 'image://data:image/png;base64,'
        }
        e.selected = !e.selected
    })
    myChart.setOption({
        legend: {
            data: legendData
        }
    })
})